import React from 'react';

const Cards = ({ person }) => {
	return(
		<div>		
			<h1>{ person.name }</h1>
			<h2>{ person.height }</h2>
			<h2>{ person.eye_color }</h2>
			<h2>{ hair_color }</h2>
			<h2>{ skin_color }</h2>
			<h2>{ eye_color }</h2>
			<h2>{ birth_year }</h2>
			<h2>{ gender }</h2>

		</div>			
	)
}

export default Cards;
